import React from "react";
import Navbar from './components/navbar'
import Hero from './components/hero'
import Featured from "./components/featured";
import Earn from "./components/earn";
import Footer from "./components/footer";

function App() {
  return (
    <>
       <Navbar/>
       <Hero/>
       <Featured/>
       <Earn/>
       <Footer/>
    </>
  );
}

export default App;
